import React from "react";

import Dropdown from "../../components/Dropdown";
import Table from "../../components/Table";
import SearchBox from "../../components/SearchBox"
import Footer  from   "../../components/Footer"
import Header from "../../components/User_Header";


const ChoosingRespondentsPage = () => {
    return (
        <>
      <div className="">
         <Header/>
         <div className="body">
         <div className="search">
         <SearchBox />
         
         </div>
          <Table />
         </div>
         
         <Footer/>
      </div>
      <Dropdown name="job" options={[['assistant','معاون گروه'],['teacher','استاد'],['expert','کارشناس آموزش']]} label="سمت"/>
      <Dropdown name="group" options={[['sw','نرم افزار'],['IT','فناوری ارتباطات'],['expert','هوش مصنوعی']]} label="گروه آموزشی"/>
      <Dropdown name="section" options={[['assistant','کارشناشی'],['teacher','کارشناسی ارشد'],['expert','دکترا']]} label="سمت"/>
     </> 
     );
  };
  
  export default ChoosingRespondentsPage;
